  \"An Adaptive Recurrent Neural Network for Remaining Useful Life Prediction of Lithium-ion
  Batteries\",\n\t\"tracking_summary\": {\n\t\t\"total\": 6,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
